import { useState, useEffect } from 'react';
import { get, remove } from '../Calls';
import { Button, Paper, Table, TableBody, TableCell, TableRow, TableContainer, TableHead, IconButton, TextField } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import DeleteIcon from '@material-ui/icons/Delete';
import EditIcon from '@material-ui/icons/Edit';
import { experientaRoute } from '../ApiRoutes';
import { useNavigate } from 'react-router-dom';
import { Helmet } from 'react-helmet';
import { DataGrid } from '@mui/x-data-grid';






export default function DataTable() {
    const columns = [
        {field: 'IDExperienta', headerName: 'ID Experienta', width: 70 },
        {field: 'PunctPlecare', headerName: 'Punct Plecare', width: 130 },
        {field: 'PunctSosire', headerName: 'Punct Sosire', width: 130 },
        {field: 'Localitate', headerName: 'Localitate', width: 90 },
        {field: 'MijlocTransport', headerName: 'Mijloc Transport', width: 90 },
        {field: 'OraPlecare', headerName: 'Ora Plecare', width: 90 },
        {field: 'DurataCalatorie', headerName: 'Durata Calatorie', width: 90, type:'number'},
        {field: 'GradAglomerare', headerName: 'Grad Aglomerare', width: 90, type:'number' },
        {field: 'Observatii', headerName: 'Observatii', width: 90 },
        {field: 'NivelSatisfactie', headerName: 'Nivel Satisfactie', width: 90,type:'number' },
    ];

    const [rows, setRows] = useState([]);

    useEffect(async () => {
        let data = await get(experientaRoute);
        setRows(data);
    }, []);

  return (
    <div style={{ height: 400, width: '100%' }}>
      <DataGrid
        rows={{...rows}}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
      />
    </div>
  );
}
